import Dash from "./Dash";
import Tile from "./Tile";
import "./Board.css";

function  Board({t,onTileCick,turn}) {
    return ( 
        <div className="board">
         <Tile  onClick={()=>onTileCick(0)} value={t[0]} className="top-border left-border right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(1)}  value={t[1]} className="top-border left-border right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(2)}  value={t[2]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(3)}  value={t[3]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(4)}  value={t[4]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(5)}  value={t[5]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(6)}  value={t[6]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(7)}  value={t[7]} className="top-border left-border  right-border bottom-border"/>
         <Tile onClick={()=>onTileCick(8)}  value={t[8]} className="top-border left-border  right-border bottom-border"/>
         <Dash />
        </div>
     );
}

export default  Board;
